import TopMenu from './Components/TopMenu'
import Slider from './Components/Dropdown/DropdownSlider'
import img1 from './Assets/men-dropdown.jpg'
import img2 from './Assets/men-dropdown2.jpg'
import img3 from './Assets/men-dropdown3.jpg'
import './App.css';

function App() {
  return (
    <div className="App">
      <TopMenu/>
      <div className="Dropdown">
        <div className="dropdown-container flex">
          <Slider
          imgs={[img1,img2,img3]}
          width={450}
          />

        </div>
         <img src={img1}/>
          <img src={img1}/>
          <img src={img1}/>

       </div>
    </div>
  );
}

export default App;
